import React, {Component} from "react";
import "./css/homepage.css";
import {Grid, Cell} from "react-mdl";
import End from "./sub-com/end";
import Introduce from "./sub-com/homepage-introduce";
import Header from "./sub-com/header";
import Navbar from "./Navbar";


class homepage extends Component {
    state = {};

    componentDidMount() {
        const url = "/doctors/contact-session";
        const request = new Request(url, {
            method: "put",
            body: JSON.stringify({
                selectedDoctor: null
            }),
            headers: {
                Accept: "application/json, text/plain, */*",
                "Content-type": "application/json",
            },
        });
        fetch(request).then(res => {
            if (res.status === 200) {
                console.log("Selected Doctor removed")
            }
        }).catch(error => {
            console.log(error)
        });

        const url2 = "/patients/contact-session";
        const request2 = new Request(url2, {
            method: "put",
            body: JSON.stringify({
                selectedPatient: null
            }),
            headers: {
                Accept: "application/json, text/plain, */*",
                "Content-type": "application/json",
            },
        });
        fetch(request2).then(res => {
            if (res.status === 200) {
                console.log("Select Patient removed")
            }
        }).catch(error => {
            console.log(error)
        })

    };

    render() {
        return (
            <div>
                <Navbar/>
                <Grid className="headerbg">
                    <Cell col={12}>
                        <Header/>
                        <Introduce/>
                    </Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}></Cell>
                    <Cell col={12}>
                        <End/>
                    </Cell>
                </Grid>
            </div>
        );
    }
}

export default homepage;
